import React from "react";
// import "./App.js";
import logo from "../src/images/IMG_20210329_205312_237.jpg";
const Home = () => {
  return (
    <>
      <header>
        <div class="container">


            <div class="logo flex justify-center align-items">
                <img src={logo}/>
            </div>
            <div class="text flex justify-center align-items">
                <strong>Hey User! &nbsp<span class="type"></span></strong>
                <p>Here you get all awesome features to implement in you websites.So don't confuse where to start and when to start.</p>
                <p> we provide you the best youtube free channels to learn full course of Web development, Python ,java and many much more...</p>
                <div class="btn-main">
                    <a href="#">
                        <button class="btn-bg4 btn-clr1">Watch videos</button>
                    </a>
                    <a href="#">
                        <button class="btn-bg4 btn-clr2">Subscribe Our Channel</button>
                    </a>
                    <a href="">
                        <button class="btn-bg4 btn-clr3">Browse Blogs</button>
                    </a>
                </div>

            </div>

        </div>
    </header>
   
    </>
  );
};
export default Home;
